import { Component } from "react";

class Registrationclass extends Component {
    constructor(props) {
        super(props);
        this.state = {
            name: "Jangiti",
            age: 23,
            company: "ustglobal",
            
        };
    }
    render() {
        return (
            <div>
                <h1> Welcome</h1>
                <p>
                    Hi {this.state.name} you are {this.state.age} and working in
                    {this.state.company}
                </p>
            </div>
        );
    }
}

export default Registrationclass;
